    <div>
        <h2>Enter details:</h2>
        <form onsubmit="return false">
            <div>
                <label for="age">Age:</label>
                <select id="form-age" name="age" onchange="populateOximeterError()">
                    <option value="10.0">10-14</option>
                    <option value="15.0">15-19</option>
                    <option value="20.0">20-24</option>
                    <option value="25.0">25-29</option>

                    <option value="60.0">60-64</option>
                    <option value="65.0">65-69</option>
                    <option value="70.0">70-74</option>
                    <option value="75.0">75-79</option>
                    <option value="80.0">80-84</option>
                    <option value="85.0">85-89</option>
                    <option value="90.0">90-94</option>
                </select>
            </div>

            <div>
                <label for="race">Race:</label>
                <select id="form-race" name="race" onchange="populateOximeterError()">
                    <option value="native-american">American Indian / Alaska Native</option>
                    <option value="asian">Asian</option>
                    <option value="black">Black</option>
                    <option value="hispanic">Hispanic / Latino</option>
                    <option value="white">White</option>
                    <option value="other">Other</option>
                </select>
            </div>

            <div>
                <label for="sex">Sex:</label>
                <select id="form-sex" name="sex" onchange="populateOximeterError()">
                    <option value="female">Female</option>
                    <option value="male">Male</option>
                </select>
            </div>

            <div>
                <label for="region">Region:</label>
                <select id="form-region" name="region" onchange="populateOximeterError()">
                    <option value="midwest">Midwest</option>
                    <option value="northeast">Northeast</option>
                    <option value="south">South</option>
                    <option value="west">West</option>
                    <option value="other">Other</option>
                </select>
            </div>
        </form>
    </div>

    <div>
        <h2>Oximeter error rate:</h2>
        <p id="oximeterErrorDiv">NA</p>
    </div>

            }

                datum = datum[region];
            }
